    "color.scss": "\n//COLOR NAMES ARE ACCORDING TO WITH SFS'S INTERNAL CI/CD STYLEGUIDE\n\n//PRIMARY\n$color-orange: #ee7f00;\n$color-red: #e53d1e;\n\n//SECONDARY\n$color-green-3: #b6d8ad;\n$color-green-services: #009284;\n\n//GREYSCALES\n$color-gray: #f7f8f8;\n$color-gray-1: #e0e5e3;\n$color-gray-2: #a1b1ab;\n$color-gray-3: #687682;\n\n$color-white: #fff;\n$color-white-transparent: rgba(255, 255, 255, 0.85);\n\n//GRADIENTS\n$color-gradient-dark: linear-gradient(to bottom, #687682 0%,#3a4853 100%);\n$color-gradient-bright: linear-gradient(to bottom, #e0e5e3 0%,#c6d0cc 100%);\n\n\n//UNUSED COLORS, SHOULD BE REPLACED IN STYLING\n$color-unused-1: #ee66a1;\n$color-unused-2: #ee66a2;\n$color-unused-3: #ee66a3;\n$color-unused-4: #ee66a4;\n$color-unused-5: #ee66a5;\n$color-unused-6: #ee66a6;\n$color-unused-7: #ee66a7;\n$color-unused-9: #ee66a9;\n",
    "color:usage.hbs": "    {{freestyle-palette\n      colorPalette=colorpalette.primaryColours\n      title='Primary colors'\n    }}\n\n    {{freestyle-palette\n        colorPalette=colorpalette.secondaryColours\n        title='Secondary colors'\n    }}\n\n    {{freestyle-palette\n        colorPalette=colorpalette.grayColours\n        title='Grayscale colors'\n    }}\n\n    {{freestyle-palette\n      colorPalette=colorpalette.gradients\n      title='Gradients (unable to display)'\n    }}",
