    "gridsystem:usage.hbs": "\n    <div class=\"styleguide-grid-system\">\n\n      <div class=\"page-header\">\n        <h1>Bootstrap grid examples</h1>\n        <p class=\"lead\">Basic grid layouts to get you familiar with building within the Bootstrap grid system.</p>\n      </div>\n\n      <h2>Different columns for each screensize</h2>\n      <p>XXS: 0px / XS: 480px / SM: 768px / MD: 992px / LG: 1200px / XL: 1600px</p>\n      <div class=\"row\">\n        <div class=\"col-xxs-12 col-xs-6 col-sm-4 col-md-3 col-lg-2 col-xl-1\">.col-xxs-12<br>.col-xs-6<br>.col-sm-4<br>.col-md-3<br>.col-lg-2<br>.col-xl-1</div>\n        <div class=\"col-xxs-12 col-xs-6 col-sm-4 col-md-3 col-lg-2 col-xl-1\">.col-xxs-12<br>.col-xs-6<br>.col-sm-4<br>.col-md-3<br>.col-lg-2<br>.col-xl-1</div>\n        <div class=\"col-xxs-12 col-xs-6 col-sm-4 col-md-3 col-lg-2 col-xl-1\">.col-xxs-12<br>.col-xs-6<br>.col-sm-4<br>.col-md-3<br>.col-lg-2<br>.col-xl-1</div>\n        <div class=\"col-xxs-12 col-xs-6 col-sm-4 col-md-3 col-lg-2 col-xl-1\">.col-xxs-12<br>.col-xs-6<br>.col-sm-4<br>.col-md-3<br>.col-lg-2<br>.col-xl-1</div>\n        <div class=\"col-xxs-12 col-xs-6 col-sm-4 col-md-3 col-lg-2 col-xl-1\">.col-xxs-12<br>.col-xs-6<br>.col-sm-4<br>.col-md-3<br>.col-lg-2<br>.col-xl-1</div>\n        <div class=\"col-xxs-12 col-xs-6 col-sm-4 col-md-3 col-lg-2 col-xl-1\">.col-xxs-12<br>.col-xs-6<br>.col-sm-4<br>.col-md-3<br>.col-lg-2<br>.col-xl-1</div>\n        <div class=\"col-xxs-12 col-xs-6 col-sm-4 col-md-3 col-lg-2 col-xl-1\">.col-xxs-12<br>.col-xs-6<br>.col-sm-4<br>.col-md-3<br>.col-lg-2<br>.col-xl-1</div>\n        <div class=\"col-xxs-12 col-xs-6 col-sm-4 col-md-3 col-lg-2 col-xl-1\">.col-xxs-12<br>.col-xs-6<br>.col-sm-4<br>.col-md-3<br>.col-lg-2<br>.col-xl-1</div>\n        <div class=\"col-xxs-12 col-xs-6 col-sm-4 col-md-3 col-lg-2 col-xl-1\">.col-xxs-12<br>.col-xs-6<br>.col-sm-4<br>.col-md-3<br>.col-lg-2<br>.col-xl-1</div>\n        <div class=\"col-xxs-12 col-xs-6 col-sm-4 col-md-3 col-lg-2 col-xl-1\">.col-xxs-12<br>.col-xs-6<br>.col-sm-4<br>.col-md-3<br>.col-lg-2<br>.col-xl-1</div>\n        <div class=\"col-xxs-12 col-xs-6 col-sm-4 col-md-3 col-lg-2 col-xl-1\">.col-xxs-12<br>.col-xs-6<br>.col-sm-4<br>.col-md-3<br>.col-lg-2<br>.col-xl-1</div>\n        <div class=\"col-xxs-12 col-xs-6 col-sm-4 col-md-3 col-lg-2 col-xl-1\">.col-xxs-12<br>.col-xs-6<br>.col-sm-4<br>.col-md-3<br>.col-lg-2<br>.col-xl-1</div>\n      </div>\n\n      <hr>\n\n      <h2>Offset, push, and pull resets</h2>\n      <p>Reset offsets, pushes, and pulls at specific breakpoints.</p>\n      <div class=\"row\">\n        <div class=\"col-sm-5 col-md-6\">.col-sm-5 .col-md-6</div>\n        <div class=\"col-sm-5 col-sm-offset-2 col-md-6 col-md-offset-0\">.col-sm-5 .col-sm-offset-2 .col-md-6\n          .col-md-offset-0\n        </div>\n      </div>\n      <div class=\"row\">\n        <div class=\"col-sm-6 col-md-5 col-lg-6\">.col-sm-6 .col-md-5 .col-lg-6</div>\n        <div class=\"col-sm-6 col-md-5 col-md-offset-2 col-lg-6 col-lg-offset-0\">.col-sm-6 .col-md-5 .col-md-offset-2\n          .col-lg-6 .col-lg-offset-0\n        </div>\n      </div>\n      <hr>\n      <h2>Container-wrapper (Adaptive layout)</h2>\n      <p>Container sizes:<br>XXS: fluid<br>XS: fluid<br>SM: 750px<br>MD: 970px<br>LG: 1170px<br>XL: 1570px</p>\n      <p>Container sizes aren't testable in this styleguide view because there is a .container-fluid wrapper around.</p>\n\n    </div>\n",
